from typing import List


class Solution:

    def findSubstring(self, s: str, words: List[str]) -> List[int]:
        '''
        串联所有单词的子串: 给定一个字符串 s 和一些长度相同的单词 words。找出 s 中恰好可以由 words 中所有单词串联形成的子串的起始位置。
                         注意子串要与 words 中的单词完全匹配，中间不能有其他字符，但不需要考虑 words 中单词串联的顺序。

        '''
        # 优化
        res = list()
        size = sum([len(word) for word in words])
        t1 = {}
        for w in words:
            if w not in t1:
                t1[w] = 0
            t1[w] += 1

        for i in range(len(s)):
            # 用来判断s的子串是否满足要求, 只有当tmp为空时说明子串符合要求
            # l: 正在遍历单词的左边界
            # r: 以 words 字符串数组 字符数量的右边界, 之所以+1, 因为s[l:index]是左闭右开
            # index:正在遍历的索引
            index, l, r = i, i, i+size+1
            t2 = {}
            while index < r:
                if s[l:index] not in t1:
                    index += 1
                else:
                    if s[l:index] not in t2:
                        t2[s[l:index]] = 0
                    t2[s[l:index]] += 1
                    l = index
            contain = True
            for key in t1.keys():
                if key not in t2 or t2[key] != t1[key]:
                    contain = False
            if contain :
                res.append(i)
            print('t2', t2)
        return res

    def findSubstring2(self, s: str, words: List[str]) -> List[int]:
        '''
        串联所有单词的子串: 给定一个字符串 s 和一些长度相同的单词 words。找出 s 中恰好可以由 words 中所有单词串联形成的子串的起始位置。
                         注意子串要与 words 中的单词完全匹配，中间不能有其他字符，但不需要考虑 words 中单词串联的顺序。

        '''
        # 暴力法(超时)
        res = list()
        size = sum([len(word) for word in words])
        for i in range(len(s)):
            # 用来判断s的子串是否满足要求, 只有当tmp为空时说明子串符合要求
            tmp = words.copy()
            # l: 正在遍历单词的左边界
            # r: 以 words 字符串数组 字符数量的右边界, 之所以+1, 因为s[l:index]是左闭右开
            # index:正在遍历的索引
            index, l, r = i, i, i+size+1
            while index < r:
                if s[l:index] not in tmp:
                    index += 1
                else:
                    tmp.remove(s[l:index])
                    l = index
            if len(tmp) == 0:
                res.append(i)
        return res


